import React from "react";

export function handleClick() {
    this.setState({
        status: "selected"
    });
}

function Exercises(props) {
    const { workouts, workoutSelect } = props  
    console.log(workoutSelect)  

    return (
        <div className="col-md-3">
            <h1>Exercises <i className="fa fa-plus"></i></h1>
            <ul id="selectionList">
                { workouts.map( exercise => {
                        return <li key={exercise._id}><span onClick={() => this.workoutSelect(exercise).bind(this)}  className="plus"><i className="fa fa-plus"></i></span>{exercise.title}</li>
                    })}      
            </ul>
        </div>
    )
}
export default Exercises;

